import React from 'react';
import Home from './pages/home/home'
import {BrowserRouter as Router, Route, Switch} from 'react-router-dom'
// import { CSSTransition } from 'react-transition-group';

const App = () => {
  return (
    <>
      <Router>
        {/* <CSSTransition
        timeout={300}
        className="fade"
        > */}
          <Switch>
            <Route exact path="/" component={Home}/>
          </Switch>
        {/* </CSSTransition> */}
      </Router>
    </>
  );
}

export default App;
